import React, { useState, useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col, Tab, Nav, Button } from "react-bootstrap";
import '../../styles/styles.css';

export default function Testcase(props){
    // let [question, setQuestion] = useState([]);

    // useEffect(() => {
    //   fetch("http://localhost:3001/31")
    //     .then(res => res.json())
    //     .then(data => {
    //         setQuestion(data);
    //       },
    //       (error) => {
    //         setQuestion(error);
    //       }
    //     )
    // }, []);

    return(
        <div class="testcase">
            <Container>
                <Row>
                    <Col>
                        <div class="test-title">TEST CASE</div>
                    </Col>
                    <Col style={{textAlign: 'right'}}>
                        <Button variant="primary" type="submit">Run code</Button>
                    </Col>
                </Row>
            </Container>

            {props.question.map(quest => {
                const {
                    testcase_input_1,
                    testcase_output_1,
                    testcase_input_2,
                    testcase_output_2
                } = quest;
                return (
                <Tab.Container id="testcase-tabs" defaultActiveKey="first">
                    <Row>
                        <Col sm={4}>
                            <Nav variant="pills" className="flex-column">
                                <Nav.Item>
                                    <Nav.Link eventKey="first">
                                        Testcase 1
                                    </Nav.Link>
                                </Nav.Item>
                                <Nav.Item>
                                    <Nav.Link eventKey="second">
                                        Testcase 2
                                    </Nav.Link>
                                </Nav.Item>
                            </Nav>
                        </Col>
                        <Col sm={8} id="test-content">
                            <Tab.Content id="tabsc">
                                <Tab.Pane eventKey="first" >
                                    <p>Input:</p>
                                    <p>{testcase_input_1}</p>
                                    <p>Expected Output:</p>
                                    <p>{testcase_output_1}</p>
                                    <p>Actual Output:</p>
                                    <p>Result:</p>
                                </Tab.Pane>
                                <Tab.Pane eventKey="second">
                                    <p>Input:</p>
                                    <p>{testcase_input_2}</p>
                                    <p>Expected Output:</p>
                                    <p>{testcase_output_2}</p>
                                    <p>Actual Output:</p>
                                    <p>Result:</p>
                                </Tab.Pane>
                            </Tab.Content>
                        </Col>
                    </Row>
                </Tab.Container>
                );
            })}
        </div>
    );
};
